import React, { Component } from 'react';
import Grid from '@mui/material/Unstable_Grid2';
import ResponsiveAppBar from './appBar';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea, ButtonGroup, Button, TextField, IconButton, Divider } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import Box from '@mui/material/Box';
import { FacebookOutlined, Instagram, PhotoCamera, Telegram, YouTube } from '@mui/icons-material';
import { color } from '@mui/system';

import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';

const darkTheme = createTheme({
    palette: {
        mode: 'dark',
    },
});

const lightgrey = '#434A54';
const darkgrey = '#282c31';
const Home = () => {
    return (
        <ThemeProvider theme={darkTheme}>
            <CssBaseline />
            <ResponsiveAppBar />
            <Grid mt={2}>
                <Grid xs={8}>
                    <TextField
                        id='1'
                        label=''
                        variant='outlined'
                        color='primary'
                        size='small'
                        // value={}
                        // onChange={}
                        sx={{ width: '' }}
                    />
                </Grid>
                <Button color='primary' aria-label='upload picture' component='label' variant='outlined' size='large'>
                    <SearchIcon />
                </Button>
            </Grid>
            <Grid
                container
                spacing={{ xs: 2, md: 4, lg: 5 }}
                columns={{ xs: 4, sm: 8, md: 12 }}
                style={{ margin: '1rem' }}
            >
                {Array.from(Array(6)).map((_, index) => (
                    <Grid xs={2} sm={4} md={4} key={index}>
                        <Card sx={{ maxWidth: 345 }}>
                            <CardActionArea>
                                <CardMedia
                                    component='img'
                                    height='140'
                                    image='https://mui.com/static/images/cards/contemplative-reptile.jpg'
                                    alt='green iguana'
                                />
                                <CardContent>
                                    <Typography gutterBottom variant='h5' component='div'>
                                        Lizard
                                    </Typography>
                                    <Typography variant='body2' color='text.secondary'>
                                        Lizards are a widespread group of squamate reptiles, with over 6,000 species,
                                        ranging across all continents except Antarctica
                                    </Typography>
                                </CardContent>
                            </CardActionArea>
                        </Card>
                    </Grid>
                ))}
            </Grid>
            <ButtonGroup variant='outlined' color='primary' aria-label=''>
                <Button>1</Button>
                <Button>2</Button>
            </ButtonGroup>
            <Divider sx={{ margin: '2rem', bgcolor: 'black' }} />
            <ButtonGroup variant='text' color='primary' aria-label='' sx={{ margin: '2rem' }}>
                <Button size='large'>
                    <Instagram />
                </Button>
                <Button size='large'>
                    <Telegram />
                </Button>
                <Button size='large'>
                    <YouTube />
                </Button>
            </ButtonGroup>
            <Typography variant='body1' color='GrayText'>
                Terms of Use
            </Typography>
            <Typography variant='body1' color='GrayText'>
                Privacy Policy
            </Typography>
        </ThemeProvider>
    );
};

export default Home;
